import Portfolio from 'components/portfolio2.js'
import Footer from 'components/footer'
class App extends React.Component {
    render() {
        return ( <div>
            <Header/>
            <div id = "About">
            <About/>
            <div>
            </div> <div>
            <Contact/>
            </div> <div>
